    for entry in event_data:
        # Extract necessary fields from the input data
        id = entry.get('p1', '')
        name = entry.get('p3', '')
        date_raw = entry.get('p4', '').strip() if entry.get('p4') else ''
        category = entry.get('p5', '')
        location = entry.get('p6', '')
        image = "https://static7.campusgroups.com" + entry.get('p11', '')  # Assuming the base URL is constant
        rsvp = entry.get('p18', '')

        # Check if the date_raw is in a valid format
        if date_raw:
            # Attempt to extract and reformat the date
            date_match = re.search(r'(\w{3},\s\w{3}\s(\d{1,2}),\s(\d{4})\s(\d{1,2}):\d{2}\s([AP]M))', date_raw)
            if date_match:
                # Extract and format the date
                date_str = date_match.group(0)  # e.g. "Sat, Oct 19, 2024 8 AM"
                date_object = datetime.strptime(date_str, '%a, %b %d, %Y %I %p')
                formatted_date = date_object.strftime('%a %b %d %Y 18:00:00 GMT-0600 (Mountain Daylight Time)')  # Change time as needed
            else:
                formatted_date = date_raw  # Fallback to original date_raw if no match is found
        else:
            formatted_date = ""

        # Construct the event info string
        info = f"{name}. {formatted_date}. {location}."

        # Create the event dictionary and append it to the events list
        event = {
            "id": id,
            "name": name,
            "date": formatted_date,
            "category": category,
            "location": location,
            "building": location.split(',')[0].strip().lower() if ',' in location else location.lower(),
            "image": image,
            "rsvp": rsvp,
            "info": info
        }
        events.append(event)
    
    return events

